import React from 'react';
import './Header.css';


class Header extends React.Component {
  render() {
    return (
    	<div className="header">
	    	<h1>The Liu Family</h1>
	    	<p>A collection of the Liu Family's home videos throughout the years</p>
    	</div>
    );
  }
}

export default Header;
